import React from 'react';
import Chart from './Charts';
import { thisExpression } from '@babel/types';

class NameForm extends React.Component {
    constructor(props) {
      super(props);
      this.state = {name: 'select', week: 'select'};

      this.handleNameChange = this.handleNameChange.bind(this);
      this.handleWeekChange = this.handleWeekChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleNameChange(event) {
        this.setState({name: event.target.value});
    }

    handleWeekChange(event) {
        this.setState({week: event.target.value});
    }

    handleSubmit(event) {
        (this.state.name == 'select') || (this.state.week == 'select') ? alert("don't forget your name!") : alert("name: " + this.state.name + ". week: " + this.state.week);

        // alert('name is ' + this.state.value);
        event.preventDefault();
    }

    render() {
      return (
        <form onSubmit={this.handleSubmit}>
            <label>
            Name<br></br>
            <select value={this.state.name} onChange={this.handleNameChange}>
                {/* <option selected value="">Select:</option> */}
                <option value="select">Select:</option>
                <option value="belle">Belle</option>
                <option value="fia">Fia</option>
                <option value="joshua">Joshua</option>
                <option value="kiefe">Kiefe</option>
                <option value="syafii">Syafii</option>
                <option value="syed">Syed</option>
                <option value="wanNing">Wan Ning</option>
            </select>
            </label>
            <select value={this.state.week} onChange={this.handleWeekChange}>
                {/* <option selected value="">Select:</option> */}
                <option value="select">Select:</option>
                <option value="weekone">Week 1</option>
                <option value="weektwo">Week 2</option>
                <option value="weekthree">Week 3</option>
                <option value="weekfour">Week 4</option>
            </select>
            <input type="submit" value="Submit" />
        </form>
      );
    }
  }

  export default NameForm;
